import React, { useState } from 'react';

function Fortest1(props) {
  const [fruitList, setFruitList] = useState([
    '사과',
    '배',
    '포도',
    '수박',
    '머루',
  ]);
  return (
    <div>
      {fruitList.map((a, b) => {
        return (
          <>
            <li>{a}</li>;<li>{b}</li>;
          </>
        );
      })}
    </div>
  );
}

export default Fortest1;
